/**
 * Convert a WAV file to OGG format using sox.
 * @param {String} wavFilePath - The path of the WAV file to convert.
 */

  
    const sox = require('sox-stream');
    const { Readable, Writable } = require('stream');
    const soxPath = 'C:\\Program Files (x86)\\sox-14-4-2\\sox.exe';
    
    function convertToMulaw(wavBase64) {
      return new Promise((resolve, reject) => {
        // Decode base64 to buffer
        const wavBuffer = Buffer.from(wavBase64, 'base64');

        // Save the buffer to a file
    // const inputPath = 'input.ogg';
    // fs.writeFileSync(inputPath, wavBuffer);
    
        // Create a readable stream from the buffer
        const readableStream = Readable.from(wavBuffer);
    
        // Create a writable stream to collect the output
        const chunks = [];
        const writableStream = new Writable({
          write(chunk, encoding, callback) {
            console.log('Received chunk of data');
            chunks.push(chunk);
            callback();
          }
        });

        // Set up the SoX transformation
        const transform = sox({
          input: {
            type: 'ogg',
          },
          output: {
            type: 'raw',
            encoding: 'mu-law',
            rate: 8000,
            channels: 1,
          },
          soxPath: soxPath, // Specify the path here
        });

        transform.on('error', (err) => {
            console.error('SoX transform error:', err);
          });
    
        // Pipe the streams
        readableStream
          .pipe(transform)
          .pipe(writableStream)
          .on('finish', () => {
            const resultBuffer = Buffer.concat(chunks);
            const resultBase64 = resultBuffer.toString('base64');
            resolve(resultBase64);
          })
          .on('error', (error) => {
            reject(error);
          });
      });
    }
    
    // Usage example
    async function example() {
      try {
        const wavBase64 = '';
        const mulawBase64 = await convertToMulaw(wavBase64);
        console.log('Converted -law base64:', mulawBase64);
      } catch (error) {
        console.error('Conversion error:', error);
      }
    }
    
    example();